import React from 'react';
import "./exclusive.css";
import bgimg from "./assets/bg-image.jpg";

const ImageSection = () => (
  <div className="lphoto">
    {Array(4)
      .fill()
      .map((_, index) => (
        <img src={bgimg} alt="bgimg" className="h" key={index} />
      ))}
  </div>
);

export default ImageSection;
